import "./Post.modules.css";
import {Link, useNavigate } from 'react-router-dom'
import Perfil from "./Perfil";
import Perfil2 from './Perfil2';
import Globais from "./Globais";
import VerPerfil from "./VerPerfil";

function Post({user, texto}){
    const navigate = useNavigate();

    const abrirPerfil = (user) => { 
        Globais.user2 = user; 
        //navigate('/account');
    }
    return (
        <div className="post">
            <div className="user">
            <img class="profile-pic mr-3" src="https://i.pinimg.com/236x/1e/04/fd/1e04fd17f397b0513736628602fd9583.jpg" />
                <header>{user}</header>
                <button onClick={abrirPerfil(user)}>{user}</button>
            </div>
            
            <p className="texto">{texto}</p>
            
             <p> </p>
        </div>
    )
}

export default Post;

